import React from 'react';
import vk from "../assets/img/icons/vk.svg";
import instagram from "../assets/img/icons/instagram.svg";
import twitter from "../assets/img/icons/twitter.svg";
import gitHub from "../assets/img/icons/gitHub.svg";
import linkedin from "../assets/img/icons/linkedIn.svg";
import {Link} from "react-router-dom";

function Footer() {
    return (
        <footer className="footer">
            <div className="container">
                <div className="footer__wrapper">
                    <ul className="social">
                        <li className="social__item"><Link to=""><img src={vk} alt="Link"/></Link></li>
                        <li className="social__item"><a href="#!"><img src={instagram}
                                                                       alt="Link"/></a></li>
                        <li className="social__item"><a href="#!"><img src={twitter} alt="Link"/></a>
                        </li>
                        <li className="social__item"><a href="#!"><img src={gitHub} alt="Link"/></a>
                        </li>
                        <li className="social__item"><Link loc="https://www.linkedin.com/in/sayat-araqelyan-37a984256/"><img
                            src={linkedin}
                            alt="Link"/></Link></li>
                    </ul>
                    <div className="copyright">

                    </div>
                </div>
            </div>
        </footer>
    );
}

export default Footer;
